create table marks
    (ID varchar(5),
    course_id varchar(8),
    sec_id varchar(8),
    semester varchar(6),
    year numeric(4,0),
    grade numeric(2,2),
    primary key (ID, course_id, sec_id, semester, year),
    foreign key (course_id, sec_id, semester, year) references section
    (course_id, sec_id, semester, year)
    on delete cascade,
    foreign key (ID) references student (ID)
    on delete cascade
);

